function q = q(l1, l2, xei, yei, zei, xp, yp, zp, al, a, b, c)
k = 0;
q = zeros(1,4);
q(1) = asin((zp^3*abs(c)*abs(l1) - zei^3*abs(c)*abs(l1) - l1^2*zei*abs(c)*abs(l1) + l2^2*zei*abs(c)*abs(l1) + l1^2*zp*abs(c)*abs(l1) - l2^2*zp*abs(c)*abs(l1) - xei^2*zei*abs(c)*abs(l1) + xei^2*zp*abs(c)*abs(l1) - xp^2*zei*abs(c)*abs(l1) + xp^2*zp*abs(c)*abs(l1) - yei^2*zei*abs(c)*abs(l1) + yei^2*zp*abs(c)*abs(l1) - yp^2*zei*abs(c)*abs(l1) + yp^2*zp*abs(c)*abs(l1) - 3*zei*zp^2*abs(c)*abs(l1) + 3*zei^2*zp*abs(c)*abs(l1) + a^(1/2)*l1*xei^2*cos(al)^2 + a^(1/2)*l1*xp^2*cos(al)^2 + a^(1/2)*l1*yei^2*sin(al)^2 + a^(1/2)*l1*yp^2*sin(al)^2 + 2*xei*xp*zei*abs(c)*abs(l1) - 2*xei*xp*zp*abs(c)*abs(l1) + 2*yei*yp*zei*abs(c)*abs(l1) - 2*yei*yp*zp*abs(c)*abs(l1) - 2*a^(1/2)*l1*xei*xp*cos(al)^2 + a^(1/2)*l1*xei*yei*sin(2*al) - a^(1/2)*l1*xei*yp*sin(2*al) - a^(1/2)*l1*xp*yei*sin(2*al) + a^(1/2)*l1*xp*yp*sin(2*al) - 2*a^(1/2)*l1*yei*yp*sin(al)^2)/(2*b*l1*abs(c)*abs(l1))) + 2*k*pi;
q(2) = 2*k*pi - asin((zei^3*abs(c)*abs(l1) - zp^3*abs(c)*abs(l1) + l1^2*zei*abs(c)*abs(l1) - l2^2*zei*abs(c)*abs(l1) - l1^2*zp*abs(c)*abs(l1) + l2^2*zp*abs(c)*abs(l1) + xei^2*zei*abs(c)*abs(l1) - xei^2*zp*abs(c)*abs(l1) + xp^2*zei*abs(c)*abs(l1) - xp^2*zp*abs(c)*abs(l1) + yei^2*zei*abs(c)*abs(l1) - yei^2*zp*abs(c)*abs(l1) + yp^2*zei*abs(c)*abs(l1) - yp^2*zp*abs(c)*abs(l1) + 3*zei*zp^2*abs(c)*abs(l1) - 3*zei^2*zp*abs(c)*abs(l1) + a^(1/2)*l1*xei^2*cos(al)^2 + a^(1/2)*l1*xp^2*cos(al)^2 + a^(1/2)*l1*yei^2*sin(al)^2 + a^(1/2)*l1*yp^2*sin(al)^2 - 2*xei*xp*zei*abs(c)*abs(l1) + 2*xei*xp*zp*abs(c)*abs(l1) - 2*yei*yp*zei*abs(c)*abs(l1) + 2*yei*yp*zp*abs(c)*abs(l1) - 2*a^(1/2)*l1*xei*xp*cos(al)^2 + a^(1/2)*l1*xei*yei*sin(2*al) - a^(1/2)*l1*xei*yp*sin(2*al) - a^(1/2)*l1*xp*yei*sin(2*al) + a^(1/2)*l1*xp*yp*sin(2*al) - 2*a^(1/2)*l1*yei*yp*sin(al)^2)/(2*b*l1*abs(c)*abs(l1)));
q(3) = pi + asin((zei^3*abs(c)*abs(l1) - zp^3*abs(c)*abs(l1) + l1^2*zei*abs(c)*abs(l1) - l2^2*zei*abs(c)*abs(l1) - l1^2*zp*abs(c)*abs(l1) + l2^2*zp*abs(c)*abs(l1) + xei^2*zei*abs(c)*abs(l1) - xei^2*zp*abs(c)*abs(l1) + xp^2*zei*abs(c)*abs(l1) - xp^2*zp*abs(c)*abs(l1) + yei^2*zei*abs(c)*abs(l1) - yei^2*zp*abs(c)*abs(l1) + yp^2*zei*abs(c)*abs(l1) - yp^2*zp*abs(c)*abs(l1) + 3*zei*zp^2*abs(c)*abs(l1) - 3*zei^2*zp*abs(c)*abs(l1) + a^(1/2)*l1*xei^2*cos(al)^2 + a^(1/2)*l1*xp^2*cos(al)^2 + a^(1/2)*l1*yei^2*sin(al)^2 + a^(1/2)*l1*yp^2*sin(al)^2 - 2*xei*xp*zei*abs(c)*abs(l1) + 2*xei*xp*zp*abs(c)*abs(l1) - 2*yei*yp*zei*abs(c)*abs(l1) + 2*yei*yp*zp*abs(c)*abs(l1) - 2*a^(1/2)*l1*xei*xp*cos(al)^2 + a^(1/2)*l1*xei*yei*sin(2*al) - a^(1/2)*l1*xei*yp*sin(2*al) - a^(1/2)*l1*xp*yei*sin(2*al) + a^(1/2)*l1*xp*yp*sin(2*al) - 2*a^(1/2)*l1*yei*yp*sin(al)^2)/(2*b*l1*abs(c)*abs(l1))) + 2*k*pi;
q(4) = pi - asin((zp^3*abs(c)*abs(l1) - zei^3*abs(c)*abs(l1) - l1^2*zei*abs(c)*abs(l1) + l2^2*zei*abs(c)*abs(l1) + l1^2*zp*abs(c)*abs(l1) - l2^2*zp*abs(c)*abs(l1) - xei^2*zei*abs(c)*abs(l1) + xei^2*zp*abs(c)*abs(l1) - xp^2*zei*abs(c)*abs(l1) + xp^2*zp*abs(c)*abs(l1) - yei^2*zei*abs(c)*abs(l1) + yei^2*zp*abs(c)*abs(l1) - yp^2*zei*abs(c)*abs(l1) + yp^2*zp*abs(c)*abs(l1) - 3*zei*zp^2*abs(c)*abs(l1) + 3*zei^2*zp*abs(c)*abs(l1) + a^(1/2)*l1*xei^2*cos(al)^2 + a^(1/2)*l1*xp^2*cos(al)^2 + a^(1/2)*l1*yei^2*sin(al)^2 + a^(1/2)*l1*yp^2*sin(al)^2 + 2*xei*xp*zei*abs(c)*abs(l1) - 2*xei*xp*zp*abs(c)*abs(l1) + 2*yei*yp*zei*abs(c)*abs(l1) - 2*yei*yp*zp*abs(c)*abs(l1) - 2*a^(1/2)*l1*xei*xp*cos(al)^2 + a^(1/2)*l1*xei*yei*sin(2*al) - a^(1/2)*l1*xei*yp*sin(2*al) - a^(1/2)*l1*xp*yei*sin(2*al) + a^(1/2)*l1*xp*yp*sin(2*al) - 2*a^(1/2)*l1*yei*yp*sin(al)^2)/(2*b*l1*abs(c)*abs(l1))) + 2*k*pi;
end
